function ImagenCargadaCaptura() {
  return (
    <div className='imgencontrada'>Imagen Cargada
      <div className='muestraimagen'>
      <img
              src={URL.createObjectURL(imagenCargada)}
              alt={`Imagen Cargada`}
              className='result'
              style={{ width: '200px', height: '300px' }}
            />  </div>
    </div>

  )
}

export default ImagenCargadaCaptura;
